import React, { Component } from "react";
import AddUser from "./components/AddUser";
class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      users: [
        {
          id: 1,
          name: "Ali",
          email: "ali@gmail.com",
        },
        {
          id: 2,
          name: "Ahmet",
          email: "ahmet@gmail.com",
        },
        {
          id: 3,
          name: "Peri",
          email: "peri@gmail.com",
        },
      ],
    };
  }
  render() {
    return (
      <div className="container">
        <h4>User App</h4>
        <hr />
        <AddUser />
      </div>
    );
  }
}

export default App;
